import styles from './styles.css'
export default function Header() {
    return (
        <nav className={styles.navbar}>
            <img src={logo} alt="Logomarca" />
            <div className={styles.list}>
                <ul>
                    <li></li>
                </ul>

            </div>
        </nav>
    )
}
